import { useNavigate } from "react-router-dom";
import React, {useEffect, useState} from 'react';


export default function LoginPage() {
    useEffect(() => {
        fetch('/api/test', {
            method: "GET",
            headers: {
                'Content-Type': 'application/json'
            }
        })
        .then(response => response.json())
        .then(data => {
            console.log(data);
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });
    }, [])
    return <div className="login-page">
        <div>
            <h1>Extension Request <br></br> System Login</h1>
            <h2></h2>
            <p>Username: </p>
            <input type="text" id ="nicknameEnter" placeholder="Username" required/>
            <p>Password</p>
            <input type="password" id ="passwordEnter" placeholder="Password" required/>
        </div>
    </div>;
}
